import React from "react";
impo;
import { SvenskaCvPage } from "../componments/SvenskaCvPage";

function Routing() {
  return (
    <Router>
      {props.children}
      <Routes>
        <Route exact path="/svensk" element={<SvenskaCvPage />} />
        <Route exact path="/game" element={<GameView />} />
        <Route path="*" element={<PageNotFound />} />
      </Routes>
    </Router>
  );
}

export default Routing;
